import React, { useState } from "react";
import {
  Alert,
  Modal,
  StyleSheet,
  Text,
  View,
  TouchableOpacity,
  Button,
  FlatList,
  Image,
} from "react-native";
import { SafeAreaView } from "react-native-safe-area-context";
import connect from "../api/connect";

const News = () => {
  const [outputs, setOutputs] = useState();

  const request = connect.get('/Release', {}).then((result) => {
    setOutputs(result.data);
  });
  return <FlatList 
  data={outputs}
  renderItem={({item}) => {
    return <SafeAreaView>
      <Text>{item.name}</Text>
    </SafeAreaView>;
  }} />
    
  
};

const styles = StyleSheet.create({
  
});

export default News;
